import React from "react";
import List from "../models/List.js";
export default class Data extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return(
            <div className="Data">
                <div className="card bg-primary">
                    <div class="card-header text-light text-center">Add</div>
                        <div className="card-body">
                            <p className="card-text">
                                <ul class="list-group list-group-flush">
                                    {this.props.data.state && <li class="list-group-item"><label>State:</label>{this.props.data.state}</li>}
                                    {this.props.data.date && <li class="list-group-item"><label>Date:</label>{this.props.data.date}</li>}
                                    {this.props.data.cases && <li class="list-group-item"><label>Cases:</label>{this.props.data.cases}</li>}
                                    {this.props.data.deaths && <li class="list-group-item"><label>Deaths:</label>{this.props.data.deaths}</li>}
                                </ul>
                            </p>
                        </div> 
                    </div>
                
                <div className="List">
                    {this.props.data.list && <List list = {this.props.data.list}/>}
                </div>
            </div>
        )
    }
}
